import React from 'react';
import classes from './Brands.module.css';
import nikesb from './images/nikesb.png';
import jordan from './images/jordan.png';
import nike from './images/nike.png';
import newbalance from './images/newbalance.png';
import { Link } from 'react-router-dom';
import Nike from '../pages/Nike/Nike';

const Brands = () => {
  return (
    <div>
      <div className={classes.brands__wrapper}>
        <div className={classes.brands__title}>БРЕНДЫ</div>
        <div className={classes.brands__title}>СМОТРЕТЬ ВСЕ</div>
      </div>
      <div style={{ display: 'flex' }}>
        <Link to="/nike" className={classes.brand__navigation}>
          <div style={{ backgroundImage: `url(${nike})` }}>NIKE</div>
        </Link>
        <Link to="/nike-sb" className={classes.brand__navigation}>
          <div style={{ backgroundImage: `url(${nikesb})` }}>NIKE SB</div>
        </Link>
        <Link to="/new-balance" className={classes.brand__navigation}>
          <div style={{ backgroundImage: `url(${newbalance})` }}>NEW BALANCE</div>
        </Link>
        <Link to="/jordan">
          <div  style={{ backgroundImage: `url(${jordan})` }}>JORDAN</div>
        </Link>
      </div>
    </div>
  );
};

export default Brands;
